package com.mine.application.avatar.ui;

import lombok.RequiredArgsConstructor;
import org.springframework.ai.audio.transcription.AudioTranscriptionPrompt;
import org.springframework.ai.audio.transcription.AudioTranscriptionResponse;
import org.springframework.ai.openai.OpenAiAudioTranscriptionModel;
import org.springframework.ai.openai.OpenAiAudioTranscriptionOptions;
import org.springframework.ai.openai.api.OpenAiAudioApi;
import org.springframework.core.io.Resource;
import org.springframework.core.io.ResourceLoader;
import org.springframework.http.ResponseEntity;
import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.RestController;

import java.io.File;
import java.io.FileOutputStream;
import java.io.IOException;
import java.util.Base64;
import java.util.UUID;

@RequiredArgsConstructor
@RestController
public class SttTest {

    private final ResourceLoader resourceLoader;
    private final OpenAiAudioTranscriptionModel openAiAudioTranscriptionModel;

    @GetMapping("/test")
    public ResponseEntity<?> test() {
        String file = "";
        byte[] binary = Base64.getDecoder().decode(file);

        File target = new File("./temp/tempVoice/" + fileNameConvert("temp", "webm"));
        target.getParentFile().mkdirs();
        try {
            target.createNewFile();
            target.setReadable(true);
        } catch (IOException e) {
            throw new RuntimeException(e);
        }


        try (FileOutputStream fos = new FileOutputStream(target)) {
            fos.write(binary);
        } catch (IOException e) {
            throw new RuntimeException(e);
        }

        Resource audioFile = resourceLoader.getResource("file:" + target.getAbsolutePath());

        OpenAiAudioApi.TranscriptResponseFormat responseFormat = OpenAiAudioApi.TranscriptResponseFormat.JSON;

        OpenAiAudioTranscriptionOptions transcriptionOptions = OpenAiAudioTranscriptionOptions.builder()
                .withLanguage("ko")
                .withPrompt("Ask not this, but ask that")
                .withTemperature(0f)
                .withResponseFormat(responseFormat)
                .build();
        AudioTranscriptionPrompt transcriptionRequest = new AudioTranscriptionPrompt(audioFile, transcriptionOptions);
        AudioTranscriptionResponse response = openAiAudioTranscriptionModel.call(transcriptionRequest);

        return ResponseEntity.ok().body(response.getResults().get(0).getOutput());
    }

    private static String fileNameConvert(String fileName, String extension) {
        StringBuilder sb = new StringBuilder();
        UUID uuid = UUID.randomUUID();

        sb.append(uuid).append("-").append(fileName).append(".").append(extension);
        return sb.toString();
    }

}
